import './App.css';
import Signup from './pages/Signup';
import Login from './pages/Login';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      {/* <Routes> */}
      <Route exact path="/" element={<Signup />} />
      <Route exact path="/login" element={<Login />} />
      {/* </Routes> */}
    </BrowserRouter>
  );
}

export default App;
